import React from 'react';
import { Box, MenuItem, Typography, Button, TextField, InputAdornment } from '@material-ui/core';
import { FormikHelpers, Formik, Form, Field, FieldProps } from 'formik';
import { ModelOTP } from './model';


const OTP = () => {
    return (
        <Box>
            <Box textAlign="left" padding="20px" marginTop="20px">
                <Typography variant="h4" component="h4" >DayOne</Typography>
            </Box>
            <Box>
                <Box marginBottom="20px">
                    <Typography variant="h4" component="h4" >Let's get started!</Typography>
                </Box>
                <Box>
                    <Formik
                        initialValues={{
                            country: '',
                            phone: ''
                        }}
                        onSubmit={(
                            values: ModelOTP,
                            { setSubmitting }: FormikHelpers<ModelOTP>
                        ) => {
                            setTimeout(() => {
                                console.log(values, 'value----')
                                setSubmitting(false);
                            }, 500);
                        }}
                    >
                        {({ submitForm }) => (
                            <Form>
                                <Field
                                    name='country'
                                >
                                    {({
                                        field
                                    }: FieldProps<ModelOTP>) => (

                                        <TextField
                                            value={field.value || ''}
                                            onChange={field.onChange}
                                            name={field.name}
                                            variant="outlined"
                                            label="Country"
                                            select
                                            InputProps={{
                                                startAdornment: <InputAdornment position="start">+65</InputAdornment>,
                                            }}
                                        >
                                            <MenuItem value={10}>Ten</MenuItem>
                                            <MenuItem value={20}>Twenty</MenuItem>
                                            <MenuItem value={30}>Thirty</MenuItem>
                                        </TextField>

                                    )}
                                </Field>
                                <Box marginTop="20px">
                                    <Button
                                        variant="contained"
                                        color="primary"
                                        onClick={submitForm}
                                    >
                                        Submit
                                    </Button>
                                </Box>

                            </Form>
                        )}
                    </Formik>
                </Box>

            </Box>

        </Box >
    )
}

export default OTP;
